import PropTypes from 'prop-types'

function ExerciseList(props) {
    console.log(props)
    return (
        <div>
             {props.exercises && props.exercises.map(exercises => {
                 <ul>
                return (
                    <div key = {exercises.exercise_name}>
                    <h3>{exercises.exercise_name}</h3>
                    <h3>{exercises.description}</h3>
                    <h3>{exercises.difficulty}</h3>
                    </div>

                )
                </ul>
            })}

        </div>
    )
}

